INSERT INTO `wp_231r16p5s2_posts` VALUES(1, 1, '2017-10-19 10:00:15', '2017-10-19 03:00:15', 'What goes into a blog post? Helpful, industry-specific content that: 1) gives readers a useful takeaway, and 2) shows you''re an industry expert. \r\n\r\nUse your company''s blog posts to opine on current industry topics, humanize your company, and show how your products and services can help people.', 'Blog Post Title', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2017-10-19 10:00:15', '2017-10-19 03:00:15', '', 0, 'http://c26.34a.myftpupload.com/?p=1', 0, 'post', '', 1);
INSERT INTO `wp_231r16p5s2_posts` VALUES(2, 1, '2017-10-19 10:00:15', '2017-10-19 03:00:15', '\n				<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/about-us-1.jpg" alt="about-us-1" itemprop="image"  />\n	<h3>Our Approach</h3>\n<p>You could also call this heading "Our philosophy" or "Our vision." This is the place to talk about what drives you and your business and what''s unique about your process. What you write here should be something distinct and interesting about your business that sets it apart from others in the same industry.</p>\n	<h3>Our Story</h3>\n<p>Every business has a beginning, and this is where you talk about yours. People want to know what opportunity you saw or how your passion led to the creation of something new. Talk about your roots--people wanna know you have some.</p>\n	<h3 style="text-align: center;">Meet the Team</h3>\n<p style="text-align: center;">Write something about the people who make your business go or your philosophy behind customer service.<br />\nWhy? Because people want to know who they''re doing business with. It''s a human thing.</p>\n				<img src="http://c26.34a.myftpupload.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-1-square.jpg" alt="about-us-headshot-1" itemprop="image"  />\n	<h3>Regan McCook</h3>		\n			<p style="text-align: center;"><em>Founder &amp; CEO</em></p>\n	<p style="text-align: center;">Include a short bio with an interesting fact about the person.</p>\n				<img src="http://c26.34a.myftpupload.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-2-square.jpg" alt="about-us-headshot-2" itemprop="image"  />\n	<h3>Eric Teagan</h3>		\n			<p style="text-align: center;"><em>Vice President</em></p>\n	<p style="text-align: center;">Include a short bio with an interesting fact about the person.</p>\n				<img src="http://c26.34a.myftpupload.com/wp-content/uploads/bb-plugin/cache/about-us-headshot-3-square.jpg" alt="about-us-headshot-3" itemprop="image"  />\n	<h3>Timothy Barrett</h3>		\n			<p style="text-align: center;"><em>CFO</em></p>\n	<p style="text-align: center;">Include a short bio with an interesting fact about the person.</p>\n		<h3>Next Steps...</h3>\n		<p>This is should be a prospective customer''s number one call to action, e.g., requesting a quote or perusing your product catalog.</p>\n			<a href="" target="_self" role="button">\n							Call to Action\n					</a>\n', 'About Us', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2017-10-19 10:00:15', '2017-10-19 03:00:15', '', 0, 'http://c26.34a.myftpupload.com/?page_id=2', 0, 'page', '', 0);
INSERT INTO `wp_231r16p5s2_posts` VALUES(160, 1, '2017-10-19 10:00:15', '2017-10-19 03:00:15', '\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-1a.jpg" alt="" />			\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-1b.jpg" alt="" />			\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-1c.jpg" alt="" />			\n				<a href="#"><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 512 512">\n<path d="M398.572,104.287L246.857,256.001l151.715,151.714c3.617,3.618,5.428,7.904,5.428,12.856c0,4.953-1.811,9.238-5.428,12.857 l-47.428,47.428c-3.619,3.619-7.904,5.428-12.857,5.428s-9.238-1.809-12.857-5.428l-212-212c-3.619-3.618-5.428-7.904-5.428-12.856 c0-4.953,1.81-9.238,5.428-12.857l212-212c3.619-3.618,7.904-5.428,12.857-5.428s9.238,1.81,12.857,5.428l47.428,47.429 C402.189,82.19,404,86.476,404,91.428c0,4.953-1.811,9.238-5.428,12.857V104.287z"/>\n</svg>\n</a>\n				<a href="#"><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 512 512">\n<path d="M113.428,407.713l151.715-151.714L113.428,104.285c-3.617-3.618-5.428-7.904-5.428-12.856c0-4.953,1.811-9.238,5.428-12.857 l47.428-47.428c3.619-3.619,7.904-5.428,12.857-5.428s9.238,1.809,12.857,5.428l212,212c3.619,3.618,5.429,7.904,5.429,12.856 c0,4.953-1.81,9.238-5.429,12.857l-212,212c-3.619,3.618-7.904,5.428-12.857,5.428s-9.238-1.81-12.857-5.428l-47.428-47.429 c-3.617-3.618-5.428-7.904-5.428-12.856c0-4.953,1.811-9.238,5.428-12.857V407.713z"/>\n</svg>\n</a>\n	<h4>Product / Service Categories</h4>\n<h2>Project Name</h2>\n<p>Talk about this portfolio piece--who you did it for and why, plus what the results were (potential customers love to hear about real-world results). Discuss any unique facets of the project--was it accomplished under an impossible deadline?--and show how your business went above and beyond to make the impossible happen.</p>\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-2a.jpg" alt="" />			\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-2b.jpg" alt="" />			\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-2c.jpg" alt="" />			\n			<img src="http://c26.34a.myftpupload.com/wp-content/uploads/2017/04/portfolio-2d.jpg" alt="" />			\n				<a href="#"><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 512 512">\n<path d="M398.572,104.287L246.857,256.001l151.715,151.714c3.617,3.618,5.428,7.904,5.428,12.856c0,4.953-1.811,9.238-5.428,12.857 l-47.428,47.428c-3.619,3.619-7.904,5.428-12.857,5.428s-9.238-1.809-12.857-5.428l-212-212c-3.619-3.618-5.428-7.904-5.428-12.856 c0-4.953,1.81-9.238,5.428-12.857l212-212c3.619-3.618,7.904-5.428,12.857-5.428s9.238,1.81,12.857,5.428l47.428,47.429 C402.189,82.19,404,86.476,404,91.428c0,4.953-1.811,9.238-5.428,12.857V104.287z"/>\n</svg>\n</a>\n				<a href="#"><svg version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" viewBox="0 0 512 512">\n<path d="M113.428,407.713l151.715-151.714L113.428,104.285c-3.617-3.618-5.428-7.904-5.428-12.856c0-4.953,1.811-9.238,5.428-12.857 l47.428-47.428c3.619-3.619,7.904-5.428,12.857-5.428s9.238,1.809,12.857,5.428l212,212c3.619,3.618,5.429,7.904,5.429,12.856 c0,4.953-1.81,9.238-5.429,12.857l-212,212c-3.619,3.618-7.904,5.428-12.857,5.428s-9.238-1.81-12.857-5.428l-47.428-47.429 c-3.617-3.618-5.428-7.904-5.428-12.856c0-4.953,1.811-9.238,5.428-12.857V407.713z"/>\n</svg>\n</a>\n	<h4>Product / Service Categories</h4>\n<h2>Project Name</h2>\n<p>Talk about this portfolio piece--who you did it for and why, plus what the results were (potential customers love to hear about real-world results). Discuss any unique facets of the project--was it accomplished under an impossible deadline?--and show how your business went above and beyond to make the impossible happen.</p>\n', 'Portfolio', '', 'publish', 'closed', 'closed', '', 'portfolio', '', '', '2017-10-19 10:00:15', '2017-10-19 03:00:15', '', 0, 'http://c26.34a.myftpupload.com/?page_id=160', 0, 'page', '', 0);
